import * as React from 'react';
import IconButton from '@mui/material/IconButton';
import Stack from '@mui/material/Stack';
import instalogo from "./assets/instagram-logo.png"
import Home from '@mui/icons-material/Home';
import Search from '@mui/icons-material/Search';
import Explore from '@mui/icons-material/Explore';
import Reels from '@mui/icons-material/Slideshow';
import Messages from '@mui/icons-material/Chat';



export default function Leftbar() {
  return (
    <div>
        <img src={instalogo} alt="instalogo"  width={"100px"}/>
        <br />
       <h1> <Home fontSize='large'/> Home</h1>
       <h1> <Search fontSize='large'/> Search</h1>
       <h1> <Explore fontSize='large'/> Explore</h1>
       <h1> <Reels fontSize='large'/> Reels</h1>
       <h1> <Messages fontSize='large'/> Messages</h1>

    </div>
  )
}
